Vibesss so many Queens that came out to support Higher Influence Society’s 1st event! @higherinfluencesociety 

Higher Influence Society is a group of like minded individuals that want to use their influence for a higher purpose. 

To enrich and enlighten the lives of others through education, mentorship, and community. 

Your not late! We are just getting started and I’m posting on my page YOUR official invitation to #higherinfluencesociety this coming Monday with actionable steps on how you can starts and be apart of this amazing community. ❤️

